import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Home.module.css';
import CapaceteIcon from './icons/capacete.svg'; // Substitua com o caminho correto para seus ícones
import CanetaIcon from './icons/caneta.svg';
import CadernoIcon from './icons/caderno.svg';
import ChaveRoscaIcon from './icons/chave-rosca.svg';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className={styles.container}>
      <h1 className={`${styles.title} mb-4 text-center`}>Portal do Funcionário</h1>
      <div className={styles.box}>
        <div className="d-flex flex-column align-items-center gap-2 w-100">
          <button className="btn btn-primary w-100 max-w-300" onClick={() => navigate('/Login')}>Entrar</button>
          <button className="btn btn-secondary w-100 max-w-300" onClick={() => navigate('/Cadastrar')}>Cadastrar</button>
        </div>
      </div>
      <h2 className={`${styles.rodape} mb-4 text-center`}>Desenvolvido por Leonardo Dias</h2>

      {/* Elementos decorativos */}
      <div className={styles['decorative-elements']}>
        <img src={CapaceteIcon} alt="Capacete de operário" />
        <img src={CanetaIcon} alt="Caneta" />
        <img src={CadernoIcon} alt="Caderno" />
        <img src={ChaveRoscaIcon} alt="Chave de rosca" />
      </div>
    </div>
  );
};

export default Home;
